import React from 'react';

function Logbook() {
  // Group entries by week
  const entries = [
    {
      week: 'Week 12',
      dates: [
        {
          date: '2024-03-15',
          title: 'Neural Network Implementation',
          category: 'Technical',
          description: 'Implemented a deep learning model for image classification',
          learnings: [
            'Optimized model architecture',
            'Improved data preprocessing',
            'Enhanced validation methods'
          ]
        },
        {
          date: '2024-03-14',
          title: 'Data Visualization Project',
          category: 'Analysis',
          description: 'Created interactive dashboards for data analysis',
          learnings: [
            'D3.js implementation',
            'Real-time data updates',
            'User interaction patterns'
          ]
        }
      ]
    },
    {
      week: 'Week 11',
      dates: [
        {
          date: '2024-03-08',
          title: 'API Integration',
          category: 'Development',
          description: 'Implemented RESTful API endpoints for data processing',
          learnings: [
            'API authentication',
            'Error handling patterns',
            'Request optimization'
          ]
        }
      ]
    }
  ];

  return (
    <div className="page-container">
      <h1>Daily <span className="glow-text">Logbook</span></h1>
      <div className="content-wrapper">
        <div className="timeline-container">
          {entries.map((weekGroup, weekIndex) => (
            <div 
              key={weekGroup.week} 
              className="week-group"
              style={{
                animation: `fadeInLeft ${0.3 + weekIndex * 0.2}s ease-out`
              }}
            >
              <div className="week-marker">
                <span className="week-label">{weekGroup.week}</span>
                <div className="timeline-line"></div>
              </div>

              <div className="entries-container">
                {weekGroup.dates.map((entry, entryIndex) => (
                  <div 
                    key={entry.date}
                    className="logbook-entry"
                    style={{
                      animation: `fadeInRight ${0.5 + entryIndex * 0.1}s ease-out`
                    }}
                  >
                    <div className="entry-dot"></div>
                    <div className="entry-content">
                      <div className="entry-header">
                        <span className="entry-date">{entry.date}</span>
                        <span className={`entry-category ${entry.category.toLowerCase()}`}>
                          {entry.category}
                        </span>
                      </div>
                      <h3>{entry.title}</h3>
                      <p>{entry.description}</p>
                      <div className="learnings">
                        <h4>Key Learnings:</h4>
                        <ul>
                          {entry.learnings.map((learning, i) => (
                            <li 
                              key={i}
                              style={{
                                animation: `fadeInUp ${0.7 + i * 0.1}s ease-out`
                              }}
                            >
                              {learning}
                            </li>
                          ))}
                        </ul>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Logbook;
